        public void CalculateChangeReturnsExpectedValue(
            MethodModifiers oldModifiers,
            MethodModifiers newModifiers,
            SemVerChangeType expected)
        {
            var oldMethod = new TestMethodDefinition().Set(x => x.Modifiers = oldModifiers);
            var newMethod = new TestMethodDefinition().Set(x => x.Modifiers = newModifiers);
            var match = new ItemMatch<IMethodDefinition>(oldMethod, newMethod);

            var actual = MethodModifiersChangeTable.CalculateChange(match);

            actual.Should().Be(expected);
        }
    }
